import React, { Component } from "react";

class main extends Component {
  constructor(props) {
    super(props);
    this.Ref = React.createRef()
  }
  click = () => {
    if (this.Ref) {
      this.Ref.current.focus()
    }
  }

  render() {
    return (
      <div>
        <input ></input>
        <button onClick={this.click}>Click</button>
      </div>
    );
  }
}

export default main;
